DROP TABLE getzichanxifen;
CREATE TABLE getzichanxifen (name varchar(64) NOT NULL, huobi double(64,1), zhaiquan double(64,1), yitouru double(64,1), guonei_zichan double(64,1), lundong_zichan double(64,1), haiwai_zichan double(64,1), zongji double(64,1), PRIMARY KEY (name)) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 DEFAULT COLLATE=utf8mb4_0900_ai_ci;
DROP TABLE hsag;
CREATE TABLE hsag (sj date NOT NULL, spdw double(64,2), pe_cv double(64,2), pb_cv double(64,2), ps_cv double(64,2), zonghe_pos double(64,4), PRIMARY KEY (sj)) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 DEFAULT COLLATE=utf8mb4_0900_ai_ci;
DROP TABLE payment;
CREATE TABLE payment (id int NOT NULL, serial varchar(64), PRIMARY KEY (id)) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 DEFAULT COLLATE=utf8mb4_0900_ai_ci;
DROP TABLE tbl_employee;
CREATE TABLE tbl_employee (id int NOT NULL AUTO_INCREMENT, last_name varchar(50), email varchar(50), gender char(1), age int, PRIMARY KEY (id)) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 DEFAULT COLLATE=utf8mb4_0900_ai_ci;
DROP TABLE totalasset;
CREATE TABLE totalasset (riqi datetime NOT NULL, totalasset double(64,2), PRIMARY KEY (riqi)) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 DEFAULT COLLATE=utf8mb4_0900_ai_ci;
